import React from 'react';
import Header from '../Header/Index';
import Table from './Table';
import { Col,Row } from 'antd';
const Index=(props)=> {
    return (
        <div>         
          <Row>
        <Col flex={1}>
          <Header />
        </Col>
        <Col flex={4}>
          <Table />
        </Col>
      </Row>
        </div>
           
        
    );
}

export default Index;
